import React from "react";

const FilterBox = ({ filterID }) => {
  const testPrint = () => {
    console.log("ye man");
  };

  return (
    <React.Fragment>
      <div>
        <label>
          {filterID}
          <input
            type="checkbox"
            id={filterID}
            onClick={event.target.checked ? testPrint : null}
          />
        </label>
      </div>
    </React.Fragment>
  );
};

export default FilterBox;
